import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';

function Warehouse() {
	let [warehouse, setWarehouse] = useState();
	let id = useParams().id;

	useEffect(() => {
		fetch(`api/${id}`)
			.then((res) => {
				res.json();
			})
			.then((data) => {
				console.log(data);
				setWarehouse(data);
			});
	}, []);
	return <div>{id}</div>;
}

export default Warehouse;
